import React, { Component } from "react";
import "./App.css";

export default class App extends Component {
  render() {
    return (
      <div className="container">
        <div className="todoBlock">
          <div className="title">
            <h1>할 일 목록</h1>
          </div>
          <div>
            <input type="checkbox" defaultChecked={false} />
            공부하기
            <button style={this.bu}>x</button>
          </div>
        </div>
      </div>
    );
  }
}
